import React from 'react';
import '.././style/App.css';

function Movies(props){


    return(
      <div>
        <div class="titre">
          <p>
            Popular Movies
          </p>
        </div>
        <tbody>
          {
            props.data.map(row =>(
              <p> row.rank </p>
            ))
          }
        </tbody>

      </div>
    );

}

export default Movies;
